import React from "react";
import "./App.css";

const App = () => {
  return (
    <div className="app-style">
      <div className="box-style">감자</div>
      <div className="box-style">고구마</div>
      <div className="box-style">오이</div>
      <div className="box-style">가지</div>
      <div className="box-style">옥수수</div>
    </div>
  );
};

export default App;
